// Get the input array of objects
const objectArray = Inputs.ObjectArray || [];

// Check if the input array is not empty
if (!objectArray.length) throw new Error('Input array is empty');

try {
  // Convert each object in the array to a string and store them in a new array
  const stringArray = objectArray.map(object => object.Label);

  // Output the new array of strings
  Outputs.StringArray = stringArray;

  // Filter the array to only include objects where Checked is true
  const savedSelection = objectArray.filter(object => object.Checked === true);

  // Output the filtered array of objects
  Outputs.SavedSelection = savedSelection;

  // Output the original unfiltered array of objects
  Outputs.ObjectArray = objectArray;

  // Signal that the operation was successful
  Outputs.Success();
} catch (error) {
  // Output the error
  Outputs.error = error;

  // Signal that the operation failed
  Outputs.Failure();
}

// Get the input object array
