// Define the input "Selection"
const selection = Inputs.Selection || '';

// Check if the selection is not empty
if (!selection) {
  Outputs.error = 'Invalid selection';
  Outputs.Failure();
  return;
}

try {
  // Save the selection to the output "SavedSelection"
  Outputs.SavedSelection = selection;

  // Save the selection to localStorage
  localStorage.setItem('SavedSelection', selection);

  // Signal that the operation was successful
  Outputs.Success();
} catch (error) {
  // Output the error and signal failure
  Outputs.error = 'Failed to save selection: ' + error.message;
  Outputs.Failure();
}

// Function to save state of inputs
function saveInputState(inputName, inputValue) {
  if (inputValue !== undefined && inputValue !== null) {
    localStorage.setItem(inputName, inputValue);
    Outputs[inputName] = inputValue;
  }
}

// Function to load state from localStorage
function loadState() {
  // Load the saved selection
  const savedSelection = localStorage.getItem('SavedSelection');
  if (savedSelection) {
    Outputs.SavedSelection = savedSelection;
  }

  // Load state for other inputs
  const villager1Checkbox = document.querySelector('[data-node-name="Villager 1"] input[type="checkbox"]');
  if (villager1Checkbox) {
    const villager1Checked = localStorage.getItem('Villager 1') === 'true';
    villager1Checkbox.checked = villager1Checked;
  }

  const textbox1 = document.getElementById('Textbox1');
  if (textbox1) {
    const textbox1Value = localStorage.getItem('Textbox1');
    textbox1.value = textbox1Value || '';
  }
}

// Load state on initialization
document.addEventListener("DOMContentLoaded", loadState);

// Save state when inputs change
const villager1Checkbox = document.querySelector('[data-node-name="Villager 1"] input[type="checkbox"]');
if (villager1Checkbox) {
  villager1Checkbox.addEventListener('change', (event) => {
    saveInputState('Villager 1', event.target.checked);
  });
}

const textbox1 = document.getElementById('Textbox1');
if (textbox1) {
  textbox1.addEventListener('input', (event) => {
    saveInputState('Textbox1', event.target.value);
  });
}

if (!Inputs.Options) return // No options, no fun

// Use the existing input objects if they have the necessary structure
Component.Object.AllOptions = Inputs.Options;

// Filter checked options if necessary
Component.Object.CheckedOptions = Component.Object.AllOptions.filter(o => o.Checked);

// Filter out checked options, this will have changed when the user clicked
// a checkbox or pill
Component.Object.CheckedOptions = Component.Object.AllOptions.filter(o => o.Checked)

// Create selection from checked options, only return value
Component.Object.Selection = Component.Object.CheckedOptions.map(o => o.Value)

Outputs.Changed()
